import './App.css';

import React, { useState } from 'react';

const App = () => {
  const [user, setUser] = useState(null)

  React.useEffect(() => {
    fetch('http://localhost:8080/user')
      .then(results => results.json())
      .then(data => {
       setUser(data)
      });
  }, []);

  return (
    <div className="App">
      <header className="App-header">

      </header>
    </div>
  );
}

export default App;
